        "name": "npe01__Contacts_And_Orgs_Settings__c",
        "label": "npe01__Contacts_And_Orgs_Settings__c",
        "fieldCount": 15,
        "keyFields": [
          {
            "name": "Advancement_Namespace__c",
            "type": "Text",
            "label": "GEM Namespace",
            "desc": "For system use only: Namespace for cross package functionality."
          },
          {
            "name": "Automatic_Campaign_Member_Management__c",
            "type": "Checkbox",
            "label": "Automatic Campaign Member Management",
            "desc": "Automatically creates a Campaign Member when you create an Opportunity that has a Primary Contact and a Primary Campaign source associated with it, or update that Opportunity with a Closed/Won stage."
          },
          {
            "name": "Campaign_Member_Non_Responded_Status__c",
            "type": "Text",
            "label": "Campaign Member Non Responded Status",
            "desc": "The automatic Status of a Campaign Member for Open or Closed/Lost opportunities that have a Primary Contact and a Primary Campaign Source associated with them. If left blank, Salesforce uses the first non-Responded status."
          },
          {
            "name": "Campaign_Member_Responded_Status__c",
            "type": "Text",
            "label": "Campaign Member Responded Status",
            "desc": "The automatic Status of the Campaign Member for Closed/Won opportunities that have a Primary Contact and a Primary Campaign Source associated with them. If left blank, Salesforce uses the first Responded status."
          },
          {
            "name": "Contact_Role_for_Organizational_Opps__c",
            "type": "Text",
            "label": "Contact Role for Organizational Opps",
            "desc": "The default Contact Role automatically assigned to the Opportunity&apos;s Primary Contact when the Opportunity&apos;s Account is NOT a Household, One-to-One, or Individual Account."
          },
          {
            "name": "Enforce_Accounting_Data_Consistency__c",
            "type": "Checkbox",
            "label": "Enforce Accounting Data Consistency",
            "desc": "Enables rules and automation that enforce consistency in accounting data."
          },
          {
            "name": "Honoree_Opportunity_Contact_Role__c",
            "type": "Text",
            "label": "Honoree Opportunity Contact Role",
            "desc": "Populating this setting will automatically create a Contact Role for Opportunities with an honoree Contact. Leaving this field blank will disable automatic Contact Role creation for the honoree."
          },
          {
            "name": "Household_Account_Addresses_Disabled__c",
            "type": "Checkbox",
            "label": "Household Account Addresses Disabled",
            "desc": "Disables Address management for Household Accounts when selected."
          },
          {
            "name": "Max_Payments__c",
            "type": "Number",
            "label": "Max Payments",
            "desc": "Determines the maximum number of payments available in the Payment Creation Wizard."
          },
          {
            "name": "Notification_Recipient_Opp_Contact_Role__c",
            "type": "Text",
            "label": "Notification Recipient Opp Contact Role",
            "desc": "Populating this setting will automatically create a Contact Role for Opportunities with a notification recipient Contact. Leaving this field blank will disable automatic Contact Role creation for the notification recipient."
          },
          {
            "name": "Opp_RecTypes_Excluded_for_Payments__c",
            "type": "Text",
            "label": "Excluded Opp Record Types",
            "desc": "Salesforce won&apos;t automatically create Payments for the selected Opportunity record types. Control or Command click to select more than one record type."
          },
          {
            "name": "Opp_Types_Excluded_for_Payments__c",
            "type": "Text",
            "label": "Excluded Opp Types",
            "desc": "Salesforce won&apos;t automatically create Payments for Opportunities that have this value in the Type picklist."
          },
          {
            "name": "Organizational_Account_Addresses_Enabled__c",
            "type": "Checkbox",
            "label": "Organizational Account Addresses Enabled",
            "desc": "Enables Address management for Organizational Accounts when selected."
          },
          {
            "name": "Payments_Auto_Close_Stage_Name__c",
            "type": "Text",
            "label": "Opportunity Stage for When Fully Paid",
            "desc": "Salesforce automatically sets an Opportunity&apos;s Stage to this value when the Payment Amount Received is equal to the Opportunity Amount. If no stage is selected, the Opportunity Stage won&apos;t change when payments are complete."
          },
          {
            "name": "Simple_Address_Change_Treated_as_Update__c",
            "type": "Checkbox",
            "label": "Simple Address Change Treated as Update",
            "desc": "If checked, changes to a single Contact or Account address field update the existing Address, rather than creating a new Address."
          }
        ],
